import { useState, useEffect } from 'react';
import { API, graphqlOperation  } from 'aws-amplify';
import { listProteinAnnotationTables } from './graphql/queries';
import './styles.css';

//const initialState  = { name: '', description: '' }

function Predictions(props) {

  //const [formState, setFormState] = useState(initialState)
  const [predictions, setPredictions] = useState([]);
  const currentUserID = props["userID"]

  useEffect(() => {
    fetchPredictions();
    //setTimeout(window.location.reload(), 60000);
    //window.setTimeout(function(){window.location.reload(false)}, 3000);
  }, []);

  async function fetchPredictions() {
    try {
      const todoData = await API.graphql(graphqlOperation(listProteinAnnotationTables));
      const predictions = todoData.data.listProteinAnnotationTables.items;
      console.log("Predictions...", predictions);
      console.log("userID...",  props["userID"]);

      setPredictions(predictions);
    } catch (err) { console.log('error fetching predictions') }
  }

  return (
    <div className="App">
      <h1>Predictions</h1>
      <button onClick={() => window.location.reload(100)} class="button">Refresh</button>
        <div style={{marginBottom: 30}}>
          {
            predictions.map((elm, i) => {
              return this.userID == elm.userID ?
                <div key={elm.itemID}>
                  <p>{elm.familyAccession}</p>
                  <p>{elm.confidence}</p>
                  <p>{elm.description}</p>
                  <p>{elm.familyID}</p>
                  <p>{elm.inputSequence}</p>
                  <p>{elm.itemID}</p>
                  <p>{elm.userID}</p>
                  <p>End...</p>
                </div>
                :
                <h1></h1>
                }
              )
            }
        </div>
    </div>
  );
}

export default Predictions;
